{
    "id": "35",
    "query_name": "test",
    "query": {
        "schedule": {
            "process_events": {
                "interval": 10,
                "query": "select * from process_events"
            },
            "process_file_events": {
                "interval": 10,
                "query": "select * from process_file_events"
            },
            "process_list": {
                "interval": 60,
                "query": "select * from processes",
                "snapshot": true
            },
            "socket_events": {
                "interval": 10,
                "query": "select * from socket_events"
            },
            "user_events": {
                "interval": 10,
                "query": "select * from user_events"
            }
        }
    }
}

